import React from 'react';
import HeaderContainer from '../containers/common/HeaderContainer';
import FriendsContainer from '../containers/Friends/FriendsContainer';

const FriendsPage = () => {
  return (
    <div>
      <HeaderContainer />
      <FriendsContainer />
    </div>
  );
};

export default FriendsPage;
